<template>
  <header :class="isScrolled? 'dark:bg-darkBackground bg-background shadow-md @min-md:py-1 @max-md:py-4':'py-4'"
          class="fixed z-50 left-0 right-0 max-w-[1680px] mx-auto top-0 w-full flex items-center justify-between px-6">
    <h1 class="text-[22px] font-semibold text-semi-bold tracking-tight">
      Moiz Dev
    </h1>
    <div :class="!menuOpen?'@max-md:hidden @max-md:right-[-50px]':'@max-md:right-0'"
         class="z-20 flex gap-4 text-[14px] justify-around items-center @max-md:absolute @max-md:top-[100%] @max-md:flex-col @max-md:w-[250px] @max-md:gap-[1px] @max-md:bg-white">
      <NuxtLink @click="()=>menuOpen = !menuOpen"
                class="w-full @max-md:px-5 @max-md:py-5  @max-md:dark:bg-dark-5 @max-md:bg-dark-1" v-for="tab in tabs"
                :key="tab.name" :to="tab.href">{{ tab.name }}
      </NuxtLink>
    </div>
    <span v-if="menuOpen" @click="()=>menuOpen = !menuOpen"
          class="fixed top-0 left-0 z-10 hidden @max-md:block w-screen h-screen bg-black opacity-30"></span>
    <div class="flex gap-2">
      <button
          class="p-2 rounded-md dark:bg-button bg-darkCyan hover:opacity-100 opacity-70 transition"
          @click="changeTheme()"
      >
        <svg v-if="currentTheme === 'dark'" width="16" height="16" viewBox="0 0 16 16"
             xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
          <rect width="16" height="16" fill="url(#pattern0_2116_369)"/>
          <defs>
            <pattern id="pattern0_2116_369" patternContentUnits="objectBoundingBox" width="1" height="1">
              <use xlink:href="#image0_2116_369" transform="scale(0.00195312)"/>
            </pattern>
            <image id="image0_2116_369" width="512" height="512" preserveAspectRatio="none"
                   xlink:href="data:image/png;base64,"/>
          </defs>
        </svg>
        <svg v-else width="16" height="16" viewBox="0 0 16 16" xmlns="http://www.w3.org/2000/svg"
             xmlns:xlink="http://www.w3.org/1999/xlink">
          <rect width="16" height="16" fill="url(#pattern0_2105_26)"/>
          <defs>
            <pattern id="pattern0_2105_26" patternContentUnits="objectBoundingBox" width="1" height="1">
              <use xlink:href="#image0_2105_26" transform="scale(0.00195312)"/>
            </pattern>
            <image id="image0_2105_26" width="512" height="512" preserveAspectRatio="none"
                   xlink:href="data:image/png;base64,"/>
          </defs>
        </svg>
      </button>
      <button
          class="p-2 rounded-md dark:bg-button bg-darkCyan hover:opacity-100 opacity-70 transition @min-md:hidden"
          @click="()=>menuOpen = !menuOpen"
      >
        <svg xmlns="http://www.w3.org/2000/svg" height="16px" viewBox="0 -960 960 960" width="16px" fill="#e3e3e3">
          <path d="M120-240v-80h720v80H120Zm0-200v-80h720v80H120Zm0-200v-80h720v80H120Z"/>
        </svg>
      </button>
    </div>
  </header>
</template>

<script setup>
import {reactive, defineEmits} from "vue";
import {ref, onMounted, onUnmounted} from 'vue'

const menuOpen = ref(false)
const props = defineProps(["currentTheme"]);
const emit = defineEmits(["changeTheme"]);
const tabs = reactive([
  {
    name: "Home",
    icon: "home",
    href: "/"
  },
  {
    name: "About",
    icon: "home",
    href: "/about"
  },
  {
    name: "Projects",
    icon: "home",
    href: "/projects"
  },
  {
    name: "Contact",
    icon: "home",
    href: "/contacts"
  },
])
const isScrolled = ref(false)

const handleScroll = () => {
  isScrolled.value = window.scrollY > 50
  console.log(isScrolled)
}

onMounted(() => {
  window.addEventListener('scroll', handleScroll)
})

onUnmounted(() => {
  window.removeEventListener('scroll', handleScroll)
})

const changeTheme = () => {
  emit("changeTheme");
}
</script>
